import React from 'react';
import {sum, diff, mult, div} from "./Calculator";


function App(){
    return(
        <>
           {`The sum is ${sum(1,2)}`}
           {`The diff is ${diff(3,1)}`}
           {`The mult is ${mult(4,4)}`}
           {`The divide is ${(div(22,7)).toFixed(2)}`}
        </>
    );
}

export default App;
